import React, { Component } from 'react'
import {useSpring, animated} from 'react-spring'

export default class Fold extends Component {
    render() {
        
        return (
            <div>
               <animated.div style={hellyes}>I will fade in</animated.div>
            </div>
        )
    }
}
const hellyes = useSpring({opacity: 1, from: {opacity: 0}});
